import React, { Component } from 'react';

class TOC extends Component {
    render() {
        var data = this.props.data;
        var lists = [];
        data.forEach(element => {
            lists.push(<li  ><a href={"/content/" + element.id} >{element.title}</a></li>)
        });
        return (
            <nav>
                <ul>
                    {lists}
                </ul>
            </nav>
        );
    }
}

export default TOC;
